import React from 'react';
class Header extends React.Component {
    render() {
        return(
            <div data-testid="headerTest" className="header">
                <div></div>
                <h1 id="pageTitle">Callouts</h1>
                <div id="weather">
                    <h3>Current weather in new Mombasa</h3>
                    <h3>weather goes here</h3>
                </div>
                
            </div>
        );
    }
}
export default Header;
